        issues: 'https://github.com/Brylimo/TIL/issues/43',
        title: 'React memo',
        body: '### React memo\r\n- \uc720\uc800\ub4e4\uc740 \ubc18\uc751\uc774 \ube60\ub978 UI\ub97c \uc120\ud638\ud55c\ub2e4. \uc774\ub97c \uc704\ud574 React\ub294 React.memo()\ub97c \uc81c\uacf5\ud55c\ub2e4. \ub80c\ub354\ub9c1 \uacb0\uacfc\ub97c \uba54\ubaa8\uc774\uc9d5\ud568\uc73c\ub85c\uc368 \ubd88\ud544\uc694\ud55c \ub9ac\ub80c\ub354\ub9c1\uc744 \uac74\ub108\ub6f4\ub2e4.\r\n- \ub9ac\uc561\ud2b8\uc5d0\uc11c \ubd80\ubaa8 \ucef4\ud3ec\ub10c\ud2b8\uac00 \ub80c\ub354\ub9c1\ub420 \ub54c \ud574\ub2f9 \ucef4\ud3ec\ub10c\ud2b8\uc5d0 \uc18d\ud558\ub294 \ubaa8\ub4e0 \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8 \ub610\ud55c \ub80c\ub354\ub9c1\ub41c\ub2e4. \ud558\uc9c0\ub9cc \ubd80\ubaa8 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8\ub85c \ub0b4\ub824\uc8fc\ub294 props\uac00 \ubc14\ub00c\uc9c0 \uc54a\uc558\ub2e4\uba74 \ud574\ub2f9 \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8\ub97c \ub9ac\ub80c\ub354\ub9c1\ud558\uc9c0 \uc54a\uc544\ub3c4 \ub41c\ub2e4.\r\n**\ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \ub9ac\ub80c\ub354\ub9c1\uc774 \ud544\uc694\ud55c \uc0c1\ud669\uc5d0\uc11c\ub9cc \ud574\uc8fc\ub3c4\ub85d \uc124\uc815\uc744 \ud560 \uc218 \uc788\ub294\ub370 \uc774\ub54c \uc0ac\uc6a9\ud558\ub294 \ud568\uc218\uac00 \ubc14\ub85c React.memo \ud568\uc218\uc774\ub2e4.**\r\n```JSX\r\nconst MemorizedBtn = React.memo(Btn);\r\nfunction App() {\r\n\tconst [value, setValue] = React.useState("Save Changes");\r\n\tconst changeValue = () => setValue("Revert Changes");\r\n\treturn (\r\n\t\t<div>\r\n\t\t\t<MemorizedBtn text={value} changeValue={changeValue} />\r\n\t\t\t<MemorizedBtn text="Continue" />\t\r\n\t\t</div>\r\n\t);\r\n}\r\n```',
