        issues: 'https://github.com/ral-facilities/datagateway/issues/1445',
        title: 'Upgrade to React 18',
        body: "**Description**:\r\nShould be tackled in conjunction with https://github.com/ral-facilities/scigateway/issues/1205.\r\n\r\nAt present, we are running React v17.0.2. v18 has been out for some time now and we should upgrade to the latest stable version, which currently sits at **v18.2.0**.\r\n\r\nReact 18 brings a variety of improvements and changes. It's worth having a read of the [official React 18 blog post](https://reactjs.org/blog/2022/03/29/react-v18.html) to learn of the additions it has brought (some of these you may find useful going forward!).\r\n\r\nRefer to the [official React 18 migration guide](https://reactjs.org/blog/2022/03/08/react-18-upgrade-guide.html) while tackling this issue. It's important we eliminate any deprecated code that could interfere with the upgrade. For example:\r\n\r\n![image](https://user-images.githubusercontent.com/71134574/196965646-f312cd83-f092-4b77-9873-533c5a0ca58e.png)\r\n\r\nAnd we don't want that, do we?\r\n\r\nThe only obstacle standing in React 18's way at the time this issue was created is the continuing use of Enzyme for tests (which aren't officially supported in React 17 and break entirely in React 18). Fortunately, work is underway to [migrate all remaining Enzyme tests to React Testing Library](https://github.com/ral-facilities/datagateway/issues/1440). Once that work is completed, we can begin the upgrade to React 18.\r\n\r\nFinally, all that's left to make sure of is that both SciGateway and DataGateway are upgraded to React 18 at the same time. This ensures all runs smoothly between the parent app and its plugins.\r\n\r\n**Acceptance criteria**:\r\n- [ ] Upgraded to react ^18.2.0",
